(function (){
    $(".vote-btn").click(function() {
        var el = $(this);
        var categoryId = el.attr("category-id");
        var response = $("#nomination-" + categoryId).val();
        console.log(categoryId);
        console.log(response);

        $.ajax({
           url: "/api/vote/",
           data: {response: response, category: categoryId},
           method: "POST"
        }).done(function(data) {
            console.log(data);
        });
    });
})();